import React from "react";
import ChartBar from "./ChartBar";
import "./Chart.css";
function Chart(props) {
  return (
    <div className="chart">
      {props.dataPoints.map((dataPoint) => (
        <chartBar
          key={dataPoint.label}
          value={dataPoint.value}
          maxValue={null}
          label={dataPoint.label}
        ></chartBar>
      ))}
    </div>
  );
}
export default Chart;
